class Solution {
public:
    int shortestPathBinaryMatrix(vector<vector<int>>& grid) {
        int n = grid.size();
        int m = grid[0].size();

        queue<pair<int, int> > qu;
        vector<int> dr = {0, 0, 1, -1, 1, 1, -1, -1};
        vector<int> dc = {1, -1, 0, 0, 1, -1, 1, -1};
        vector<vector<bool>> vis(n, vector<bool>(m, false));

        if(grid[0][0] ==  0) { // important case
            qu.push({0, 0});
            vis[0][0] = true;
        }
        

        for(int level = 1; qu.size() > 0; level++) {
            for(int k = qu.size(); k > 0; k--) {
                pair<int, int>& u = qu.front();
                qu.pop();

                if(u.first == n - 1 && u.second == m - 1) {
                    return level;
                }

                for(int i = 0; i < 8; i++) {
                    int vr = u.first + dr[i];
                    int vc = u.second + dc[i];

                    if(0 <= vr && vr < n && 0 <= vc && vc < m && grid[vr][vc] == 0 && vis[vr][vc] == false) {
                        qu.push({vr, vc});
                        vis[vr][vc] = true;
                    }

                }
            }
        }
        return -1;
    }
};
 
